BlocklyGamesMsg["Pond.helpText2"] = "สำหรับเป้าหมายนี้เราจะต้องยิงหลายๆครั้ง ดังนั้นให้ใช้ การวนรอบ'while (true)' เพื่อทำบางสิ่งที่ไม่สามารถกำหนดจำนวนครั้งได้อย่างแน่นอน";
